import React from 'react'
import "./episodekuruluus.css"
import ReactPlayer from 'react-player'
import { Cardkurulus } from '../CardKurulus/Cardkkurulus';

export const KurulusEpisode1 = () => {


    return (
      <div className='ena'>
      <div className='videocop'>
          <ReactPlayer url='https://youtu.be/0fTJyCTwznM' controls playing muted width="1080px" height="720px" onEnded
          />
      </div>
       
      <div className='cardepisode'>
      <h3 className='h3episodes'>Episodes</h3>
        <Cardkurulus />
      </div>
      
      </div>
    )
  };


  export const KurulusEpisode2 = () => {


